// Payment 接口
type Payment interface {
	// Name 支付通道名称
	Name() string
	// New 初始化 通道配置
	New()
	// Pay 发起支付
	Pay(orderId, paymentChannel, amount, bid string) (paymentDepositResp, error)
	// Withdraw 发起代付
	Withdraw(param WithdrawAutoParam) (paymentWithdrawalRsp, error)
	// PayCallBack 支付回调
	PayCallBack(fctx *fasthttp.RequestCtx) (paymentCallbackResp, error)
	// WithdrawCallBack 代付回调
	WithdrawCallBack(fctx *fasthttp.RequestCtx) (paymentCallbackResp, error)
}

// New 初始化配置
func NewPayment() {

	var NvnPay = new(NvnPayment)
	NvnPay.New() //NVN支付
	vnPay = NvnPay
	fmt.Println("init nvnpay:", vnPay)
}

// PayOnline 调用与pid对应的渠道, 发起充值(代收)请求
func PayOnline(fctx *fasthttp.RequestCtx, pid, amount, bid string) (map[string]string, error) {

	res := map[string]string{}
	var data paymentDepositResp

	pipe := meta.MerchantRedis.TxPipeline()
	defer pipe.Close()
	user, err := MemberCache(fctx)
	if err != nil {
		return res, err
	}
	key := fmt.Sprintf("%s:finance:manual:c:%s", meta.Prefix, user.Username)
	zcard := pipe.ZCard(ctx, key)

	_, err = pipe.Exec(ctx)
	if err != nil && err != redis.Nil {
		return res, pushLog(err, helper.RedisErr)
	}
	cd, err := ConfigDetail()
	if err != nil {
		return res, pushLog(err, helper.DBErr)
	}
	dtom := cd["deposit_time_one_max"]
	dto := cd["deposit_time_one"]
	dtomi, err := strconv.ParseInt(dtom, 10, 64)
	if err != nil {
		return res, pushLog(err, helper.DBErr)
	}
	dtoi, err := strconv.Atoi(dto)
	if err != nil {
		return res, pushLog(err, helper.DBErr)
	}
	if zcard.Val() >= dtomi {
		err = meta.MerchantRedis.SetNX(ctx, "deposit_wait", 1, time.Duration(dtoi)*time.Second).Err()
		if err != nil {
			return res, errors.New(fmt.Sprintf(`Bạn Đã Gửi %d Đơn, Tạm Thời Không Thể Gửi Tiếp, Vui Lòng Liên Hệ CSKH`, dtomi))
		}
	}
	user, err = MemberGetByName(user.Username)
	if err != nil {
		return res, err
	}

	fmt.Printf("deposit username[%s] args: %s, ts: %s  \n",
		user.Username, fctx.PostArgs().String(), time.Now().Format("2006-01-02 15:04:05"))

	p, err := CachePayment(pid)
	if err != nil {
		return res, errors.New(helper.ChannelNotExist)
	}

	if user.Tester == "1" || user.TopName == "p32015" || user.TopName == "nanfeng001" {
		fmt.Println("NewestPay p:", p)
		data, err = Pay(user, p, amount, bid)
		if err != nil {
			return res, err
		}
	} else {
		// 生成我方存款订单号
		orderId := helper.GenId()
		rnd := rand.New(rand.NewSource(time.Now().UnixNano()))
		vcode := fmt.Sprintf("%06v", rnd.Int31n(1000000))
		data = paymentDepositResp{
			Account:    "170220032003",
			BankCode:   "970432",
			BankLogo:   "data:image/png;base64,",
			CardHolder: "NGUYEN ANH KHOA",
			OrderID:    orderId,
			PayCode:    vcode,
			QrCode:     "data:image/png;base64,",
			UseLink:    1,
		}
	}
	skey := meta.Prefix + ":f:p:" + p.ID
	promoDiscount, err := meta.MerchantRedis.HGet(ctx, skey, "discount").Result()
	if err != nil && err != redis.Nil {
		//缓存没有配置就跳过
		fmt.Println(err)
	}
	pd, _ := decimal.NewFromString(promoDiscount)
	a, _ := decimal.NewFromString(amount)
	discount := pd.Mul(a).Div(decimal.NewFromInt(100))
	ts := fctx.Time().In(loc).Unix()
	// 生成我方存款订单号
	sn := fmt.Sprintf(`deposit%s%s%d%d`, data.OrderID, user.Username, ts, user.CreatedAt)
	mhash := fmt.Sprintf("%d", cityhash.CityHash64([]byte(sn)))
	d := g.Record{
		"id":                data.OrderID,
		"prefix":            meta.Prefix,
		"oid":               data.OrderID,
		"uid":               user.UID,
		"top_uid":           user.TopUid,
		"top_name":          user.TopName,
		"parent_name":       user.ParentName,
		"parent_uid":        user.ParentUid,
		"username":          user.Username,
		"channel_id":        p.ChannelID,
		"level":             user.Level,
		"cid":               p.CateID,
		"pid":               p.ID,
		"amount":            amount,
		"usdt_apply_amount": 0,
		"rate":              1,
		"state":             DepositConfirming,
		"finance_type":      helper.TransactionDeposit,
		"automatic":         "1",
		"created_at":        fmt.Sprintf("%d", ts),
		"created_uid":       "0",
		"created_name":      "",
		"confirm_at":        "0",
		"confirm_uid":       "0",
		"confirm_name":      "",
		"review_remark":     "",
		"protocol_type":     "",
		"address":           "",
		"flag":              DepositFlagThird,
		"tester":            user.Tester,
		"r":                 mhash,
		"discount":          discount.StringFixed(2),
	}

	fmt.Println("deposit d:", d)
	// 请求成功插入订单
	err = deposit(d)
	if err != nil {
		fmt.Println("insert into table error: = ", err)
		return res, errors.New(helper.DBErr)
	}

	// 记录存款行为
	_ = cacheDepositProcessingInsert(user.UID, data.OrderID, ts)

	res["id"] = data.OrderID
	res["url"] = data.Addr
	if data.QrCode != "" {
		res["qr_code"] = data.QrCode
	}
	if data.PayCode != "" {
		res["pay_code"] = data.PayCode
	}
	if data.Account != "" {
		res["account"] = data.Account
	}
	if data.BankCode != "" {
		res["bank_code"] = data.BankCode
	}
	if data.BankLogo != "" {
		res["bank_logo"] = data.BankLogo
	}
	if data.CardHolder != "" {
		res["card_holder"] = data.CardHolder
	}
	res["useLink"] = strconv.Itoa(data.UseLink)
	res["is_qr"] = "2"
	//1.QRBanking充值方式支持试玩账号自动上分，订单不需要到三方以及审核；
	//2.上分时间需要随机在发起时间的X秒后，X为每笔订单从55、59、66、69、73五个数中，随机一个（离线充值也需要同步调整）；
	//例如：试玩账号11:01:50发起订单，则系统在11:02:45，订单自动审核通过完成上分（随机到55秒的情况）；
	if user.Tester == "0" && user.TopName != "p32015" && user.TopName != "nanfeng001" {
		msg := map[string]string{}
		msg["order_id"] = data.OrderID
		_ = rocketPutDelay("recharge_tester", msg, randSliceValue([]int{14, 15, 16, 17, 18}))
	}

	return res, nil
}

// Pay 发起支付公共入口
func Pay(user Member, p FPay, amount, bid string) (paymentDepositResp, error) {

	data := paymentDepositResp{}

	ch, err := ChannelTypeById(p.ChannelID)
	if err != nil {
		return data, errors.New(helper.ChannelNotExist)
	}

	fmt.Println("Pay ch = ", ch)

	// 检查存款金额是否符合范围
	a, ok := validator.CheckFloatScope(amount, p.Fmin, p.Fmax)
	if !ok {
		return data, errors.New(helper.AmountOutRange)
	}

	amount = a.String()
	// 生成我方存款订单号
	orderId := helper.GenId()

	fmt.Println("Pay orderId = ", orderId)

	//// 检查用户的存款行为是否过于频繁
	//err = cacheDepositProcessing(user.UID, time.Now().Unix())
	//if err != nil {
	//	return data, err
	//}
	//
	// 向渠道方发送存款订单请求
	data, err = vnPay.Pay(orderId, p.ChannelID, amount, bid)
	fmt.Println("Pay  payment.Pay err = ", err)
	if err != nil {
		return data, err
	}

	return data, nil
}
